import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-primary bg-primary">
    <a className="navbar-brand" href="/">
        <h2 className="text-white">Google Book Search</h2>
        <ul className="navbar-nav">
            <li className="nav-item" id="home">
              <button type="button" className="btn btn-info text-white">Search Books</button>
            </li>
            <li className="nav-item" id="report">
                <button type="button" href="/save"className="btn btn-warning text-white">Saved Books</button>
            </li>
        </ul>
    </a>
</nav>

  );
}




export default Nav;
